import Link from "next/link";

const NavBar = () => {
  return (
    <nav>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/results">
        <a>Results</a>
      </Link>
    </nav>
  );
};

export default NavBar;
